	'mwe-upwiz-tutorial-error-localized-file-missing' => 'କ୍ଷମା କରିବେ, ଆମ୍ଭେ ଆପଣଙ୍କ ଭାଷାରେ ଶିକ୍ଷଣଟିଏ ପାଇ ପାରିଲୁ ନାହିଁ । ତାବଦଳରେ $1ରେ ଥିବା ଶିକ୍ଷଣଟି ଦେଖାଯାଉଅଛି ।',
