	'mwe-upwiz-upload-error-bad-extension-video-firefogg' => 'ଆପଣ ଅପଲୋଡ଼ କରିବାକୁ ବାଛିଥିବା ଭିଡ଼ିଓ ଫାଇଲଟି ଏକ ମୁକ୍ତ ଫର୍ମାଟରେ ନାହିଁ ।
