	'mwe-upwiz-error-title-hosting' => 'ଏହି ଫାଇଲଟି ଆପଣ ଆଉ କେଉଁ ଇମେଜହୋଷ୍ଟରୁ ପାଇଲା ପରି ମନେହୁଏ । ଫାଇଲର ନାମଟି ଆଉଟିକେ ଅଧିକ ବୁଝିହେଲା ଭଳି କରନ୍ତୁ । ଆହୁରି ମଧ୍ୟ, ଆପଣଙ୍କୁ ଏହି ସାଇଟଟିରେ ପ୍ରକାଶ କରିବା ନିମନ୍ତେ ଅନୁମତି ଅଛି କି ନାହିଁ ଆଉଥରେ ପରଖିନିଅନ୍ତୁ ।',
	'mwe-upwiz-error-title-thumbnail' => 'ଏହା ଏକ ସାନ ଦେଖଣା ନାମ ପରି ଦେଖାଯାଉଛି । ଦୟାକରି ଏହି ସାନଦେଖଣାଟିକୁ ଏକା ଉଇକିରେ ଆଉଥରେ ଅପଲୋଡ଼ କରନ୍ତୁ ନାହିଁ । ନହେଲେ, ଦୟାକରି ଫାଇଲ ନାମଟିକୁ ସୁଧାରି ଏହାକୁ ଭଲକରି ବୁଝିହେଲା ପରି ଦିଅନ୍ତୁ  ଯେଉଁଥିରେ ସାନଦେଖଣା ନାମ ଆଗରୁ ନଥିବ ।',
	'mwe-upwiz-error-title-fileexists-shared-forbidden' => 'ଏହି ନାମଟି ଏକ ଉପାନ୍ତ ଆବଣ୍ଟିତ ଭଣ୍ଡାରରେ ଥିବା ଫାଇଲ ପାଇଁ ସାଇତି ରଖାଯାଇଛି । ଦୟକରି ଅଲଗା ନାମଟିଏ ବାଛନ୍ତୁ ।',
